import React, { Component } from "react";
import Tweet from "./Tweet";

class Tweets extends Component {
  state = {
    tweets: [],
  };

  componentDidMount() {
    const { data } = getTweets("nodejs");
    console.log(data);
    this.setState({ data });
  }

  render() {
    return this.tweets.map((t) => {
      <Tweet tweetContent={t} />;
    });
  }
}

export default Tweets;
